public enum WalletError {

    
    
    case InvalidMnemonic(message: String)
    
    case DerivationFailed(message: String)
    
    case EncryptionFailed(message: String)
    
    case DecryptionFailed(message: String)
    
    case InvalidSeed(message: String)
    
    case InvalidPrivateKey(message: String)
    
    case InvalidAddress(message: String)
    
    case UnsupportedChain(message: String)
    
    case SigningFailed(message: String)
    
    case TransactionFailed(message: String)
    
    case Internal(message: String)
    
}


