public struct FfiConverterTypeWalletError: FfiConverterRustBuffer {
    typealias SwiftType = WalletError

    public static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> WalletError {
        let variant: Int32 = try readInt(&buf)
        switch variant {

        

        
        case 1: return .InvalidMnemonic(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 2: return .DerivationFailed(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 3: return .EncryptionFailed(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 4: return .DecryptionFailed(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 5: return .InvalidSeed(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 6: return .InvalidPrivateKey(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 7: return .InvalidAddress(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 8: return .UnsupportedChain(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 9: return .SigningFailed(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 10: return .TransactionFailed(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 11: return .Internal(
            message: try FfiConverterString.read(from: &buf)
        )
        

        default: throw UniffiInternalError.unexpectedEnumCase
        }
    }

    public static func write(_ value: WalletError, into buf: inout [UInt8]) {
        switch value {

        

        
        case .InvalidMnemonic(_ /* message is ignored*/):
            writeInt(&buf, Int32(1))
        case .DerivationFailed(_ /* message is ignored*/):
            writeInt(&buf, Int32(2))
        case .EncryptionFailed(_ /* message is ignored*/):
            writeInt(&buf, Int32(3))
        case .DecryptionFailed(_ /* message is ignored*/):
            writeInt(&buf, Int32(4))
        case .InvalidSeed(_ /* message is ignored*/):
            writeInt(&buf, Int32(5))
        case .InvalidPrivateKey(_ /* message is ignored*/):
            writeInt(&buf, Int32(6))
        case .InvalidAddress(_ /* message is ignored*/):
            writeInt(&buf, Int32(7))
        case .UnsupportedChain(_ /* message is ignored*/):
            writeInt(&buf, Int32(8))
        case .SigningFailed(_ /* message is ignored*/):
            writeInt(&buf, Int32(9))
        case .TransactionFailed(_ /* message is ignored*/):
            writeInt(&buf, Int32(10))
        case .Internal(_ /* message is ignored*/):
            writeInt(&buf, Int32(11))

        
        }
    }
}


