fileprivate struct FfiConverterSequenceTypeDerivedAddress: FfiConverterRustBuffer {
    typealias SwiftType = [DerivedAddress]

    public static func write(_ value: [DerivedAddress], into buf: inout [UInt8]) {
        let len = Int32(value.count)
        writeInt(&buf, len)
        for item in value {
            FfiConverterTypeDerivedAddress.write(item, into: &buf)
        }
    }

    public static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> [DerivedAddress] {
        let len: Int32 = try readInt(&buf)
        var seq = [DerivedAddress]()
        seq.reserveCapacity(Int(len))
        for _ in 0 ..< len {
            seq.append(try FfiConverterTypeDerivedAddress.read(from: &buf))
        }
        return seq
    }
}

